const _ = require('lodash');
const fetchTemplates = require('../../atomicassets/api/fetchTemplates');

const fetchVehicleToMark = async () => {

    return {
        Vanessa: 'Dimp',
        Turtle: 'Clunk',
        Snout: 'Dimp',
        Skittle: 'Speros',
        Serpent: 'Speros',
        Prizefighter: 'Clunk',
        Juker: 'Clunk',
        Salamander: 'Helios',
        Romé: 'Helios',
        Ravager: 'Helios',
    };

    // TODO: uncomment after turkey
    const vehicleTemplates = await fetchTemplates({
        params: {
            collection_name: 'novarallywax',
            schema_name: 'vehicles',
        },
        customProcessor: ({template}) => ({
            mark: template.immutable_data.Manufacturer,
        }),
    });

    const vehicleToMark = _(vehicleTemplates)
        .reduce((vehicleToMark, vehicle) => {
            vehicleToMark[vehicle.name] = vehicle.mark;

            return vehicleToMark;
        }, {});

    return vehicleToMark;
};

module.exports = fetchVehicleToMark;
